import React, { Component } from 'react'
import Navbar from "../components/Navbar"
import Container from "../components/HomeContainer"
import EmailForm from "../components/Email"
import Footer from "../components/Footer"

class Home extends Component {
    constructor(props) {
        super(props)
        this.state = {
            email: true,
            whichComponentToShow: 'Home'

        }
    }

    emailForm = () => {
        if (this.state.email === true) {
            this.setState({
                email: false
            })
        }
        else {
            this.setState({
                email: true,
                home:false
            })
        }
    }
    homeContents = () => {
        if (this.state.home === true) {
            this.setState({
                home: false
            })
        }
        // else {
        //     this.setState({
        //         email: true
        //     })
        // }
    }


    render() {
        return (
            <div>
                <Navbar emailForm={this.emailForm} homeContents={this.homeContents}>
                </Navbar >


                {(this.state.email) ? <Container /> : <EmailForm />}




                <Footer>
                </Footer>
            </div>
        )
    }
}
export default Home;
